import React, { Component } from "react";

class Navbar extends Component {
  render() {
    return (
      <nav className="App-navbar nav">
        <div id="nav-items">
          <a className="navbar-brand" href="#">
            <h1 className="App-title" style={{ marginRight: "15%" }}>
              Swag Search
            </h1>
          </a>
          <button type="button" className="btn btn-dark m-2">
            Search
          </button>
          <button type="button" className="btn btn-dark m-2">
            About
          </button>
          <button type="button" className="btn btn-dark m-2">
            Login / Sign Up
          </button>
        </div>
      </nav>
    );
  }
}

export default Navbar;
